#define debugArr(...)
#endif
int a, b, c;
long long n, k;

static inline int f(int x) {
    return ( (long long)a * x + b ) % 100;
}

int main(){
    cin >> a >> b >> c;
    cin >> n >> k;

    vector<long long> pos(100, -1);
    vector<int> seq; 
    seq.reserve(200);  

    int s = c;
    long long idx = 1;
    while (pos[s] == -1) {
        pos[s] = idx;
        seq.push_back(s);
        s = f(s);
        idx++;
    }

    long long mu = pos[s] - 1;          
    long long lambda = idx - pos[s];    

    vector<long long> cnt_pre(100, 0), cnt_cycle(100, 0);
    for (long long i = 0; i < mu; i++){
        cnt_pre[ seq[i] ]++;
    }

    for (long long i = mu; i < mu + lambda; i++){
        cnt_cycle[ seq[i] ]++;
    }

    vector<long long> freq(100, 0);
    if (n <= mu) {

        for (long long i = 0; i < n; i++){
            freq[ seq[i] ]++;
        }
    } else {

        for (int x = 0; x < 100; x++){
            freq[x] = cnt_pre[x];
        }
        long long rem = n - mu;
        long long full = rem / lambda;
        long long left = rem % lambda;

        for (int x = 0; x < 100; x++){
            freq[x] += cnt_cycle[x] * full;
        }

        for (long long i = 0; i < left; i++){
            freq[ seq[mu + i] ]++;
        }
    }

    long long acc = 0;
    for (int x = 99; x >= 0; x--){
        acc += freq[x];
        if (acc >= k){
            cout << x;
            return 0;
        }
    }
    return 0;
}